import React, {useState} from 'react'
import {Switch, Link} from 'react-router-dom'
import Product from './productfun'


const ProductList = () => {
    const [products, setproduct] = useState({
        '_id':'001',
        'Name': 'Battery',
        'src':'/images/battery.jpg',
        'Product_info':"High-performance e-bike battery Bosch Active and Performance 36 Volt 20.7Ah 745Wh down tube",
        'price':20,
        'colors':'Black',
        'count':1
  },
  {
    '_id':'002',
    'Name': 'Bike-hanger',
    'src':'/images/bike-carrier.jpg',
    'Product_info':"Bicycle racks and bicycle holding systems are suitable for e-bikes",
    'price':200,
    'colors':'Black',
    'count':1
},
{
    '_id':'003',
    'Name': 'Bike-tyre',
    'src':'/images/bike-tyre.jpg',
    'Product_info':"Optimised all-rounder with extra secure puncture protection",
    'price':30,
    'colors':'Black',
    'count':1
},
{
    '_id':'004',
    'Name': 'Light',
    'src':'/images/light.jpg',
    'Product_info':"Smart Vulcan Light",
    'price':20,
    'colors':'Black',
    'count':1
},
{
    '_id':'005',
    'Name': 'rear-Light',
    'src':'/images/rear-led.jpg',
    'Product_info':"ulcan Smart E-Bike rear light",
    'price':40,
    'colors':'Black',
    'count':1
},
{
    '_id':'006',
    'Name': 'Ebike',
    'src':'/images/smart-ebike.jpg',
    'Product_info':"E-bike",
    'price':700,
    'colors':'Black',
    'count':1
});
    return(
        <div className="products-page">
            {products.map(product => (
                <Product  name = {product.Name}/>
            ))}
        </div>
    );
};
export default ProductList
